import React from "react";

function TimelineList(props) {
  return (
    <div>
      <h1>{props.list.year}</h1>
      <img width="200px" src={props.list.image} alt="event" />
      <p>{props.list.event}</p>
    </div>
  );
}

export default TimelineList;
